&quot;Welcome to the Jungle&quot; is a song by American hard rock band Guns N' Roses, featured on their 1987 debut studio album, Appetite for Destruction. It was released as the band's second single on October 3, 1987 and reached number seven on the Billboard Hot 100 chart and number sixty-seven on the UK Singles Chart. In the United Kingdom, &quot;Welcome to the Jungle&quot; was backed with a live cover of AC/DC's &quot;Whole Lotta Rosie&quot;, while in the United States the B-side was &quot;Mr. Brownstone&quot; from Appetite for Destruction. The 12&quot; vinyl and 12&quot; picture disc editions of the single also featured &quot;Whole Lotta Rosie&quot;, in addition to live versions of &quot;It's So Easy&quot; and &quot;Knockin' on Heaven's Door&quot;.

In spite of the early morning airtime, the song's music video caught viewers' attention and quickly became MTV's most requested video. The video in question begins with a shot of Axl Rose disembarking a bus[New York]]. Slash can be seen briefly, sitting against a wall and drinking from a clear glass bottle in a brown paper bag. As Axl stops to watch a television through a store window, clips of the band playing live can be seen. By the end of the video Axl has transformed into a city punk, wearing the appropriate clothing, after going through a process similar to the Ludovico technique.



